GRWM with *almost* all nontoxic makeup 💄

JUST A REMINDER: switching to cleaner products is a low and slow process. It can be expensive to dive in feet first. So do what you can and don’t beat yourself up for the products you still have.

Makeup brands/ products used and what I rate them:

@nudestix bronzer stick in shade Terracotta Tan. I give this a 8/10 spread very smooth AND I didn’t realize until after but it has a brush attached to the bottom! 

@tower28beauty cream blush in Office Hours. 10/10 this spreads like absolute butter. So easy to apply and spread. Color is stunning!

@iliabeauty Limitless Lash Mascara. I don’t know why but I surely underestimated her. 9/10 very lengthening, not clumpy, not flakey and very elegant on the lashes. 

@merit Tinted Lip Oil Gloss in Sangria 🤤 wondering how this isn’t hyped up enough. 10/10 run don’t walk. The color wear is insane and is more beautiful on the skin than even in the bottle.

Looking forward to trying more nontoxic makeup brands. Let me know your thoughts on this look and what to try next ✨

